import React from 'react';
// import SharedContext from './SharedContext';
import {AppBar, Toolbar, IconButton, Box, TextField} from '@mui/material';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBack';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';

/**
 * @return {object} JSX
 */
function Composing() {
  return (
    <Box>
      <AppBar position='fixed'>
        <Toolbar sx={{justifyContent: 'space-between'}}>
        <IconButton
            role='button'
            aria-label='go back'>
            <ArrowBackIosNewIcon />
          </IconButton>
          <div>
            <IconButton
              role='button'
              aria-label='sent'>
              <ArrowForwardIcon />
            </IconButton>
          </div>
        </Toolbar>
        <TextField
                margin="normal"
                id="to"
                name="to"
                size='small'
                fullWidth
                value={searchW}
                sx={{background: 'white'}}
              />
        <TextField
                margin="normal"
                id="subject"
                name="subject"
                size='small'
                fullWidth
                value={searchW}
                sx={{background: 'white'}}
              />
        <TextField
                margin="normal"
                id="content"
                name="content"
                fullWidth
                value={searchW}
                sx={{background: 'white'}}
              />
      </AppBar>
    </Box>
  )
}

export default Composing;
